import './App.css';

import 'bootstrap/dist/css/bootstrap.min.css';
import Login from './components/Login';
import NavBar from './components/NavBar';

function App() {
  return (
    <div className="App">
      <NavBar />
        <Login />
    </div>
  );
}

export default App;
